import React from 'react'
import { BrowserRouter, Route, Switch ,Redirect,useRouteMatch} from 'react-router-dom';
import Notes from './public/notes';
import PropTypes from 'prop-types';
import Reminders from './public/reminders';
import Labels from './public/labels';
import ModifyLabels from './public/modify-labels';
import Archive from './public/archive';
import Delete from './public/Delet';

 const RightLayout = (props) => {
    console.log("props", props);
   //  const {match} =this.props;

   //  let {url} = match;
   let { path, url } = useRouteMatch();
   console.log('url', url);
   // console.log('path', path);
    return (

       <BrowserRouter>

       <Route strict path={`${path}`} component={Notes}/>


       <Route strict path={`${url}/notes`} component={Notes}/>

       <Route strict path={`${url}/reminders`} component={Reminders}/>
       <Route strict path={`${url}/labels`} component={Labels}/>
       <Route strict path={`${url}/archive`} component={Archive}/>
       <Route strict path={`${url}/modifyLabels`} component={ModifyLabels}/>
       <Route strict path={`${url}/delete`} component={Delete}/>


       </BrowserRouter>
    )
}

export default RightLayout;
